void clicked()
{
    super();

    ProdBOM  prodBomLocal;

    for (prodBomLocal = prodBOM_ds.getFirst(true) ? prodBOM_ds.getFirst(true) : prodBOM_ds.cursor();
    prodBomLocal;
    prodBomLocal = prodBOM_ds.getNext())
    {
        whsReleaseToWarehouseForm.addOrderLine(prodBomLocal.InventTransId, whsTmpReleaseToWarehouse, WHSModule::ProdBOM);
    }

    prodBOM_ds.executeQuery();
    whsTmpReleaseToWarehouse_ds.executeQuery();
}

public void clicked()
{
    super();

    if (TabPageProductionOrders.isActivePage())
    {
        whsReleaseToWarehouseForm.addProdOrder(prodBOM.ProdId, whsTmpReleaseToWarehouse);
    }

    prodBOM_ds.executeQuery();
    whsTmpReleaseToWarehouse_ds.executeQuery();
}

